import React, { useState, useEffect } from 'react';
import api from '../config/api-simple';

const TestAPI = () => {
  const [products, setProducts] = useState([]);
  const [settings, setSettings] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    testAPI();
  }, []);

  const testAPI = async () => {
    try {
      setLoading(true);
      setError(null);

      // Test 1: Health check
      console.log('üß™ Test 1: Health check');
      const health = await api.get('/health');
      console.log('‚úÖ Health:', health);

      // Test 2: Settings
      console.log('üß™ Test 2: Settings');
      const settingsData = await api.get('/settings');
      console.log('‚úÖ Settings:', settingsData);
      setSettings(settingsData.settings);

      // Test 3: Products
      console.log('üß™ Test 3: Products');
      const productsData = await api.get('/products');
      console.log('‚úÖ Products:', productsData);
      setProducts(productsData.products);

    } catch (err) {
      console.error('‚ùå Erreur API:', err);
      setError(err.message);
    } finally {
      setLoading(false);
    }
  };

  const testAdminLogin = async () => {
    try {
      console.log('üß™ Test 4: Admin Login');
      const loginData = await api.post('/auth/connexion-admin', {
        email: 'ayoubbenromdan8@gmail.com',
        motDePasse: '52141707'
      });
      console.log('‚úÖ Admin Login:', loginData);
      
      if (loginData.success) {
        localStorage.setItem('token', loginData.token);
        alert('Connexion admin r√©ussie !');
      }
    } catch (err) {
      console.error('‚ùå Erreur Admin Login:', err);
      alert('Erreur connexion admin: ' + err.message);
    }
  };

  if (loading) {
    return (
      <div style={{ padding: '20px', textAlign: 'center' }}>
        <h2>üß™ Test de l'API</h2>
        <p>Chargement...</p>
      </div>
    );
  }

  return (
    <div style={{ padding: '20px', maxWidth: '800px', margin: '0 auto' }}>
      <h2>üß™ Test de l'API - Boutique AYNEXT</h2>
      
      {error && (
        <div style={{ 
          background: '#ffebee', 
          color: '#c62828', 
          padding: '10px', 
          borderRadius: '4px',
          marginBottom: '20px'
        }}>
          <strong>‚ùå Erreur:</strong> {error}
        </div>
      )}

      <div style={{ marginBottom: '20px' }}>
        <button 
          onClick={testAPI}
          style={{
            background: '#2196f3',
            color: 'white',
            border: 'none',
            padding: '10px 20px',
            borderRadius: '4px',
            marginRight: '10px',
            cursor: 'pointer'
          }}
        >
          üîÑ Tester API
        </button>
        
        <button 
          onClick={testAdminLogin}
          style={{
            background: '#4caf50',
            color: 'white',
            border: 'none',
            padding: '10px 20px',
            borderRadius: '4px',
            cursor: 'pointer'
          }}
        >
          üîë Tester Connexion Admin
        </button>
      </div>

      {settings && (
        <div style={{ 
          background: '#f5f5f5', 
          padding: '15px', 
          borderRadius: '4px',
          marginBottom: '20px'
        }}>
          <h3>‚öôÔ∏è Param√®tres Boutique</h3>
          <p><strong>Nom:</strong> {settings.informationsGenerales.nomBoutique}</p>
          <p><strong>Email:</strong> {settings.informationsGenerales.email}</p>
          <p><strong>T√©l√©phone:</strong> {settings.informationsGenerales.telephone}</p>
        </div>
      )}

      <div>
        <h3>üì¶ Produits ({products.length})</h3>
        {products.map((product) => (
          <div key={product._id} style={{ 
            border: '1px solid #ddd', 
            padding: '15px', 
            marginBottom: '10px',
            borderRadius: '4px'
          }}>
            <h4>{product.nom}</h4>
            <p><strong>Prix:</strong> {product.prix} TND</p>
            <p><strong>Description:</strong> {product.description}</p>
            <p><strong>Couleurs:</strong> {product.couleurs.join(', ')}</p>
            <p><strong>Tailles:</strong> {product.tailles.join(', ')}</p>
            <div>
              <strong>Images:</strong>
              {product.images.map((image, index) => (
                <div key={index} style={{ marginTop: '5px' }}>
                  <img 
                    src={image} 
                    alt={`${product.nom} ${index + 1}`}
                    style={{ 
                      width: '100px', 
                      height: '100px', 
                      objectFit: 'cover',
                      border: '1px solid #ddd',
                      borderRadius: '4px',
                      marginRight: '5px'
                    }}
                    onError={(e) => {
                      e.target.style.display = 'none';
                    }}
                  />
                </div>
              ))}
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default TestAPI;
